ISLAMABAD, May 30 (APP):Indian troops in their fresh act of state terrorism martyred two more youth in Pulwama district,in Indian illegally occupied Jammu and Kashmir (IIOJK).
The troops martyred the youth during a cordon and search operation in Gundipoora area of the district, said a press release issued by All Parties Hurriyat Conference.The operation was going on till last reports came in.
